import { CssBaseline, ThemeProvider } from '@mui/material';
import './App.css';
import { darkTheme } from './Theme/DarkTheme.js';
import CustomRoute from './Routers/CustomRoute.jsx';
import Orders from './component/profile/Orders.jsx';
import Navbar from './component/navbar/Navbar.jsx';
import { createBrowserRouter } from 'react-router-dom';
import Home from './component/Home/Home.jsx';
import RestaurantDetails from './component/restaurant/RestaurantDetails.jsx';
import Cart from './component/cart/Cart.jsx';
import Profile from './component/profile/Profile.jsx';
import UserProfile from './component/profile/UserProfile.jsx';
import Favourites from './component/profile/Favourites.jsx';
import Address from './component/profile/Address.jsx';
import Events from './component/profile/Events.jsx';

const router = createBrowserRouter([
  {
    path: "/", 
    element: <Home />, 
    children: [
      {
        path: "/account/:register", 
        element: <Home />, 
      }, 
      {
        path: "/restaurant/:city/:title/:id", 
        element: <RestaurantDetails/>
      }, 
      {
        path: "/cart", 
        element: <Cart/>
      }, 
      {
        path: "/my-profile", 
        element: <Profile />, 
        children: [
          {
            path: "/", 
            element: <UserProfile/>
          }, 
          {
            path: "/orders", 
            element: <Orders/>
          }, 
          {
            path: "/favourites", 
            element: <Favourites/>
          }, 
          {
            path: "/address", 
            element: <Address/>
          }, 
          {
            path: "/notification", 
            element: <Events/>
          }
        ]
      }
    ]
  }
])

function App() {
  return (
    <ThemeProvider theme={darkTheme}>
      <CssBaseline />

      <Navbar/>
      {/* <Home /> */}
      {/* <RestaurantDetails /> */}
      {/* <Cart /> */}
      {/* <Profile /> */}
      <Orders />
      {/* <CustomRoute /> */}
    </ThemeProvider>
  );
}

export default App;
